import React from "react";
import {NavLink} from "react-scroll";

 const Navbar =() => {
  
     return(
<>
      <div className="Navbar">
       <NavLink
       activeClass="active"
       to ="Home"
       spy={true}
       smooth={true}
       offset={0}
       duration={500}
       >
       Home
       </NavLink>
       <NavLink
       activeClass="active"
       to ="About"
       spy={true}
       smooth={true}
       offset={0}
       duration={500}
       >
       About
       </NavLink>
       </div>
       </>
     ) }
 export default Navbar;
